(select CONCEPT_CODE_1 from AUT_INGR_3 );

create table AUT_INGR_4 as
select a.concept_code as concept_code_1,a.concept_name as concept_name_1,b.concept_id as concept_id_2,b.concept_name as concept_name_2,'1' as precedence
 from ingr_to_map a
join devv5.concept b 
on regexp_like (lower(a.concept_name),lower(b.concept_name))
where b.concept_class_id='Ingredient'
and b.vocabulary_id like 'Rx%'
and b.STANDARD_CONCEPT='S'
and regexp_substr(lower(a.concept_name),'\w')=regexp_substr(lower(b.concept_name),'\w')
;
