create table aut_ing_all_mapped as 
(
select CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE from AUT_INGR_1
union
select CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE from AUT_INGR_2
union
select CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE from AUT_INGR_3
union
select CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE from AUT_INGR_4
union
select CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE from AUT_INGR_5
);

Insert into AUT_ING_ALL_MAPPED (CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE)
select a.concept_code,b.concept_id,'1'  from 
(select * from drug_Concept_stage where concept_code not in (select CONCEPT_code_1 from AUT_ING_ALL_MAPPED )
and concept_class_id='Ingredient') a
Join devv5.concept b on lower(a.concept_name)=lower(b.concept_name)
where b.vocabulary_id='RxNorm' and b.STANDARD_CONCEPT='S' and b.concept_class_id='Ingredient';

Insert into AUT_ING_ALL_MAPPED (CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE)
select a.concept_code,b2.concept_id,'1'  from 
(select * from drug_Concept_stage where concept_code not in (select CONCEPT_code_1 from AUT_ING_ALL_MAPPED )
and concept_class_id='Ingredient') a
Join devv5.concept b on lower(a.concept_name)=lower(b.concept_name)
join devv5.concept_relationship cr on cr.concept_id_1=b.concept_id
join devv5.concept b2 on b2.concept_id=cr.concept_id_2
where b.vocabulary_id='RxNorm'
and b2.vocabulary_id='RxNorm' and b2.concept_class_id='Ingredient' and b2.STANDARD_CONCEPT='S';

Insert into AUT_ING_ALL_MAPPED (CONCEPT_CODE_1,CONCEPT_ID_2,PRECEDENCE)
select distinct  a.concept_code,b2.concept_id,'1'  from 
(select * from drug_Concept_stage where concept_code not in (select CONCEPT_code_1 from AUT_ING_ALL_MAPPED )
and concept_class_id='Ingredient') a
Join devv5.concept b on lower(a.concept_name)=lower(b.concept_name)
join devv5.concept_relationship cr on cr.concept_id_1=b.concept_id
join devv5.concept b2 on b2.concept_id=cr.concept_id_2
where  b2.vocabulary_id='RxNorm' and b2.concept_class_id='Ingredient' and b2.STANDARD_CONCEPT='S';

