select a.concept_code as concept_code_1,a.concept_name as concept_name_1,b.concept_id as concept_id_2,b.concept_name as concept_name_2,'1' as precedence
 from drug_concept_stage a join devv5.concept b on
lower(a.concept_name)=lower(b.concept_name)
where a.concept_class_id='Dose Form'
and b.concept_class_id='Dose Form'
and b.invalid_reason is null
and  b.VOCABULARY_ID in ('RxNorm Extension','RxNorm');

